import React, { useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { makeStyles } from '@material-ui/core/styles';
import { RootStateType } from '../store/store'; // типизация всего стейта( для типизации state)
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';
import CircularProgress from '@material-ui/core/CircularProgress';
import { Box, Container, Button } from '@material-ui/core';

import ActiveLastBreadcrumb from '../components/ActiveLastBreadcrumb';
import { connect } from 'react-redux';

//типизация---------------------------------------------------------------------
type MapStateToPropsType = {};
type MapDispathPropsType = {};
type PropsType = MapStateToPropsType & MapDispathPropsType;

//-----------------------------------------------------------------
const useStyles = makeStyles((theme) => ({
  breadcrumb: {
    marginTop: 15,
  },
}));

const Cart: React.FC<PropsType> = ({}) => {
  const classes = useStyles();

  useEffect(() => {
    // eslint-disable-next-line
  }, []);

  return (
    <Container maxWidth="lg">
      <Box className={classes.breadcrumb}>
        <ActiveLastBreadcrumb name="Карзина" />
      </Box>
      <Container maxWidth="sm">
        <Box display="flex" justifyContent="space-between" marginTop={5}>
          <Typography
            component="h1"
            variant="h5"
            align="center"
            style={{
              display: 'flex',
            }}
          >
            Карзина
          </Typography>
          <Typography color="textSecondary">очистить карзину</Typography>
        </Box>
      </Container>
    </Container>
  );
};

const mapStateToProps = (state: RootStateType): MapStateToPropsType => {
  return {};
};
export default connect<
  MapStateToPropsType,
  MapDispathPropsType,
  unknown, // первичные пропсы
  RootStateType
>(
  mapStateToProps,
  {}
)(Cart);
